function main() {
  // Get Data
  let container = document.querySelector('.catalog-body.js-catalog > .js-catalog-body .feed-grid');
  let items = container.querySelectorAll('.c-box');
  let data = [...items].map(item => {
    let imgURL = item.querySelector('.c-box__image img').src;
    let price = item.querySelector('.c-cell[role=presentation] > .c-cell__content > .c-cell__body > .c-cell[role=presentation] > .c-cell__content').textContent;
    let brand = item.querySelector('.c-cell[role=presentation] > .c-cell__content > .c-cell__body > .u-flexbox .c-box__details').textContent;
    let articleURL = item.querySelector('.c-box__image a').href;
    return { imgURL, price, brand, articleURL };
  });

  rws.log(`${document.URL} : ${items.length} items`);

  //If there is a pagination
  let selector = '.c-pagination > a.c-pagination__next';
  if (!document.querySelector(selector))
    selector = null;
  //Stop at page 4
  if (document.URL.includes('page=4'))
    selector = null;

  /** @type {ScriptAction} */
  let scriptAction = {
    data: data,
    nextPage: {
      buttonPath: selector,
      waitElemPath: null,
    }
  };
  rws.resolve(scriptAction)
}
//Starting after 1.2s to make sure the page is loaded
setTimeout(main, 1200);

let url = 'https://api.themoviedb.org/3/movie/76341?api_key=test';
let options = {
  method: 'POST',
  headers: {
    'Content-Type': 'application/json'
  },
  body: JSON.stringify(rws.data)
};

// Using fetch to send the data through POST to a random API
let response = await fetch(url, options);
let content = await response.json();
rws.log(content);
rws.resolve();

